import React, { useEffect } from "react";
import axios from "axios";

function ProductPage() {
  useEffect(() => {
    axios.get("https://dummyjson.com/products").then()
  }, []);

  return (
    <>
      <p> hello from Products </p>
    </>
  );
}

export default ProductPage;
